//=========AUTO TYPE===============

const role = "web developer";
autoType[0].innerHTML = "";

let i = 0;
function autoTyping() {
  if (i < role.length) {
    autoType[0].innerHTML += role[i];
    i++;
  } 
  else{
    autoType[0].innerHTML = "";
    i = 0;
    setTimeout(autoTyping,600);
  }
}

// run typing every 150ms for each character
setInterval(autoTyping, 150);











